import React from "react";
import { NavLink } from "react-router-dom";

const Navigation = () => {
	return (
		<div className="tab">
			<button>
				<NavLink to="/">Home</NavLink>
			</button>
			<button>
				<NavLink to="/about">About</NavLink>
			</button>
		</div>
	);
};

export default Navigation;
